import React from "react";

const HRDashboard = () => {
  return (
    <div>
      <h2>HR Dashboard</h2>
      <p>Welcome to the HR dashboard. Here you can manage employees and leave policies.</p>
    </div>
  );
};

export default HRDashboard;
